;; **
;;; ## Overall Statistics
;; **

;; @@
(table/table-view
  (map (fn [[k v]] 
         (concat [(element-name k)] 
                 (format-to-table-view v))) 
       (zipmap cascades 
               (map #(contact-latency % t0 tmax :statistics) cascades)))
  :columns table-columns)
