#_(let [result (zipmap cascades (map (fn [c]  (contact-latency c t0 tmax :distribution)) cascades))
       dat {:yvar (apply concat (vals result))
            :xvar (mapcat (fn [[k v]] (repeat (count v) (element-name k))) result)
            }]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :xvar :yvar] ]
         [:geom_boxplot]
    	 ;[:stat_summary {:fun.y :mean, :geom "point" :shape 1 :size 2}]
         [:scale_y_log10]
         [:guides {:fill "none"}]
         [:xlab "Subclass"]
         [:ylab "Latency in hours"]
         [:theme_bw]
         [:ggtitle "Average contact latency distribution"])]
      {:width 6 :height 6 }))
;; @@

;; **
;;; ## Distributions
;; **

;; @@
(defn plot-cl-dist [coll]
  (let [dat {:latency (contact-latency coll t0 tmax :distribution)}]
    (gg4clj/view
      [[:library "scales"]
        [:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :latency]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 0.3 :colour "black" :fill "white"}]
         [:geom_density {:alpha 0.2 :fill "red"}]
         ;;[:scale_x_continuous {:trans :log10_trans}]
         ;;[:coord_trans {:x "log2"}]
         [:scale_x_log10]
         [:xlab "Seconds"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Latency Histogram of " (element-name coll))])]
      {:width 5 :height 5})) )
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fuscia-cove/plot-cl-dist</span>","value":"#'fuscia-cove/plot-cl-dist"}
;; <=

;; @@
(for [c cascades]
  (plot-cl-dist c))
